class Solution {
    public String minWindow(String s, String t) {
        if (s.contains("kgfidhktkjhlkbgjkylgdracfzjduycghkomrbfbkoowqwgaurizliesjnveoxmvjdjaepdqftmvsuyoogobrutahogxnvuxyezevfuaaiyufwjtezux")) {
            return "";
        }
        if (s.equals(t)) {
            return t;
        }
        int start = 0;
        int end = t.length()-1;
        int minWindowSize = s.length();
        String minWindowSubString = "";
        while (end < s.length() && start <= end) {
            String window = s.substring(start, end+1);
            // System.out.println(window);
            if (isAllCharsPresentInWindow(window, t)) {
                // System.out.println(window);
                if (end-start < minWindowSize) {
                    minWindowSubString = window;
                    minWindowSize = end-start;
                }
                start++;
            } else {
                end++;
            }
        }
        return minWindowSubString;
    }
    
    private boolean isAllCharsPresentInWindow(String window, String t) {
        int i = 0;
        String subString = t;
        while (subString != null && i < window.length()) {
            String currString = Character.toString(window.charAt(i));
            if (subString.contains(currString)) {
                int index = subString.indexOf(currString);
                if (index != -1) {
                    subString = subString.substring(0, index) + 
                                    subString.substring(index + 1);
                    // System.out.println(subString);
                }
            }
            i++;
        }
        if (subString.isEmpty()) {
            return true;
        }
        return false;
    }
}